        HEATMAP
      </div>
      </div>
    </div>
       <div>
           { 
           val==="cryp"?<tyytf></tyytf>:null

           }
           { 
           val==="exch"?<tyytf></tyytf>:null

           }
           { 
           val==="cryp"?<tyytf></tyytf>:null

           }
       </div>
    </div>
  );
};

export default Shifting;
